import classes from './Header.module.css';

const Header = () => {
    return (
        <div className={classes.main}>
        <h2 className={classes.logo}>LOGO</h2>
      
        <nav>
            <ul>
                <li>
                    <a  href='A'>Shops</a>
                </li>
                <li>
                    <a  href='B'>Tournaments</a>
                </li>
                <li>
                    <a href='C'>Login</a>
                </li>
            </ul>
        </nav>

        <p className={classes.maintext}>What are you looking for ?</p>
</div>
    );
}
export default Header;
